import Form from "../../Components/Form";
import Header from "../../Components/Header";
import { Div } from "../../Pages/Display/style";
import cadastro from "../../Assets/cadastro.png";
function Forms() {
  return (
    <Div>
      <Header />

      <Form />
      <img src={cadastro} />
    </Div>
  );
}
export default Forms;
